syntax = "proto3";
option csharp_namespace = "YSFreedom.Common.Protocol";


message MechanicusCandidateTeamCreateRsp {
	enum CmdId {
		option allow_alias = true;
		NONE = 0;
		ENET_CHANNEL_ID = 0;
		ENET_IS_RELIABLE = 1;
		CMD_ID = 3916;
	}

	int32 retcode = 1;
	uint32 difficult_level = 2;
	uint32 dungeon_id = 3;
}
